samples_tolerance: 0.05
sample_retract_dist: 3.5 # 5 works, default (2?) doesn't.
samples_tolerance_retries: 3
activate_gcode:
    PROBE_DOWN
    G4 P1000
deactivate_gcode:
    PROBE_UP
    G4 P1000

