[gcode_macro START_PRINT]
gcode:
    {% set BED_TEMP = params.BED_TEMP|default(60)|float %}
    {% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|default(210)|float %}
    # Start bed heating
    M140 S{BED_TEMP}
    # Use absolute coordinates
    G90
    # Reset the G-Code Z offset (adjust Z offset if needed)
    #SET_GCODE_OFFSET Z=0.0
    # Turn up LED light bars
    #SET_PIN PIN=led-r VALUE=0.20
    #SET_PIN PIN=led-l VALUE=0.70
    # Home the printer
    G28
    error_if_probe_deployed        ; If probe is currently deployed, error
    # Wait for bed to reach temperature
    M190 S{BED_TEMP}
    # Tram the bed
    G32
    #Home Z
    G28 Z
    #BED_MESH_PROFILE LOAD=default       # Load default bed mesh
    # Move bed down 10
    G1 Z10 F600
    # Set and wait for nozzle to reach temperature
    M109 S{EXTRUDER_TEMP}
    # prepare to prime
    G1 X0.2 Y0.2 Z1.0 F2000.0
    # reset extrusion distance  
    G92 E0
    G1 Z0.2 F600
    # prime in two steps
    G1 X60.0 E9.0  F1000.0
    G1 X125.0 E12.5  F1000.0
    G1 Z0.5 F600
    # reset extrusion distance  
    G92 E0
    # Activate skew correction
    SKEW_PROFILE LOAD=my_skew_profile
    # End of Start macro

[gcode_macro END_PRINT]
gcode:
    M400         ; Wait for buffer to clear
    # De-activate skew correction
    SET_SKEW CLEAR=1
    # Turn off bed, extruder, and fan
    M140 S0
    M104 S0
    M106 S0
    # Move nozzle away from print while retracting
    G91
    G1 X-2 Y-2 E-3 F300
    # Raise nozzle by 10mm
    G1 Z10 F3000
    # absolute moves
    G90
    # Move Y-carriage for part removal
    G1 X10 Y280 F3000
     # Lower bed 50 unless bed is too close to bottom of printer, then lower 5
    {% if printer.toolhead.axis_maximum.z - printer.toolhead.position.z > 50 %}
        G1 Z{printer.toolhead.position.z + 50}
    {% else %}
        G1 Z{printer.toolhead.axis_maximum.z - 5}
    {% endif %}
    # Disable steppers
    M84
    # Turn down LED light bars
    SET_PIN PIN=led-r VALUE=0.15
    SET_PIN PIN=led-l VALUE=0.25

[gcode_macro CANCEL_PRINT]
rename_existing: BASE_CANCEL_PRINT
gcode:
  TURN_OFF_HEATERS
  CLEAR_PAUSE
  SDCARD_RESET_FILE
  BASE_CANCEL_PRINT

[gcode_macro PAUSE]
rename_existing: BASE_PAUSE
# change this if you need more or less extrusion
variable_extrude: 1.0
gcode:
  ##### read E from pause macro #####
  {% set E = printer["gcode_macro PAUSE"].extrude|float %}
  ##### set park positon for x and y #####
  # default is your max posion from your printer.cfg
  {% set x_park = printer.toolhead.axis_maximum.x|float - 5.0 %}
  {% set y_park = printer.toolhead.axis_maximum.y|float - 5.0 %}
  ##### calculate save lift position #####
  {% set max_z = printer.toolhead.axis_maximum.z|float %}
  {% set act_z = printer.toolhead.position.z|float %}
  {% if act_z < (max_z - 2.0) %}
      {% set z_safe = 2.0 %}
  {% else %}
      {% set z_safe = max_z - act_z %}
  {% endif %}
  ##### end of definitions #####
  SAVE_GCODE_STATE NAME=PAUSE_state
  BASE_PAUSE
  G91
  G1 E-{E} F2100
  G1 Z{z_safe} F900
  G90
  G1 X{x_park} Y{y_park} F6000

[gcode_macro RESUME]
rename_existing: BASE_RESUME
gcode:
  ##### read E from pause macro #####
  {% set E = printer["gcode_macro PAUSE"].extrude|float %}
  ##### end of definitions #####
  G91
  G1 E{E} F2100
  RESTORE_GCODE_STATE NAME=PAUSE_state
  BASE_RESUME


